            <p>Vườn quốc gia (VQG) Côn Đảo thuộc tỉnh Bà Rịa-Vũng Tàu chính thức được thành lập theo Quyết định số 135/QĐ-TTg ngày 31/3/1993 của Thủ tướng Chính phủ trên cơ sở Khu rừng cấm Côn Đảo được Chủ tịch Hội đồng Bộ trưởng thành lập tại Quyết định số 85/CT ngày 01/3/1984. </p>
            <p>VQG Côn Đảo thuộc quần đảo Côn Đảo nằm Cách cửa sông Hậu (tỉnh Cần Thơ) 83 km, cách thành phố Vũng Tàu 185 km và thành phố Hồ Chí Minh 250 km, quần đảo gồm 16 đảo nhỏ, đảo lớn nhất là Côn Sơn. Địa hình đảo Côn Sơn là vùng đồi núi, ưu thế bởi các dãy đá granit chạy từ phía Tây Nam đến Đông Bắc, che chở cho các vùng vịnh của đảo cả về hai phía khỏi những luồng gió mạnh. Những điểm cao nhất trên đảo là đỉnh Núi Thánh Giá và Núi Chúa, có độ cao 577 m và 515 m. Điểm cao nhất trên các đảo nhỏ là 350 m.</p>
            <p>VQG Côn Đảo thuộc hệ thống rừng đặc dụng, là 1 trong");
            WriteLiteral(@" 34 Vườn quốc gia của Việt Nam. Tổng diện tích tự nhiên: 19.883,15 ha, gồm: Phần diện tích bảo tồn rừng trên các hòn đảo: 5.883,15 ha. Phần diện tích bảo tồn biển: 14.000 ha. Ngoài ra, diện tích vùng đệm trên biển là: 20.500 ha. </p>
            <p>
                Ban quản lý VQG Côn Đảo đã nỗ lực giữ gìn bảo tồn tài nguyên đa dạng sinh học rừng, biển, đất ngập nước và đã được các tổ chức uy tín trong nước và quốc tế đánh giá cao và công nhận các danh hiệu VQG Côn Đảo là một Khu đất ngập nước quan trọng quốc tế, năm 2013 (Khu Ramsar); Là thành viên mạng lưới các Khu bảo tồn rùa biển Ấn Độ Dương – Đông Nam Á; Hiệp Hội bảo vệ thiên nhiên Việt Nam công nhận 02 cây Nhội và 01 cây Cóc Đỏ tại VQG Côn Đảo là Cây Di sản Việt Nam; Trung tâm sách kỷ lục Việt Nam công nhận VQG Côn Đảo là nơi nuôi, ấp và thả về thiên nhiên nhiều rùa biển nhất Việt Nam; UBND tỉnh và Bộ Tài nguyên – Môi trường đang trình hồ sơ đề cử để được công nhận là Vườn di sản ASEAN Côn Đảo.
